import React from 'react';
import './App.css';
import SmallText from './components/SmallText.js';
import TitleText from './components/TitleText.js';
import TextButton from './components/TextButton.js';
import DspButton from './components/DspButton.js';
import SwitchButton from './components/SwitchButton.js';
import NumberInput from './components/NumberInput.js';
import TabGroup from './components/ButtonGroup.js';
import {Grid} from 'semantic-ui-react';


class SpacingPage extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            streamNumber: null,
            role: null,
            recordDeal: [],
            publishDeal: [],
            sliderValue: null,
            recordDealSelected: null,
            publishingDealSelected: null,
            advance: null
        };

    }

    render() {
      return (
        <Grid celled padded style={{height: '100vh'}}>
          <Grid.Row style={{height: '50%'}}>
            <Grid.Column width={10}>
              <p>One</p>
              <p>TWO</p>
              <p>THREE</p>
            </Grid.Column>
            <Grid.Column width={6}>
              <p>Two</p>
            </Grid.Column>
          </Grid.Row>

          <Grid.Row style={{height: '50%'}}>
            <Grid.Column width={10}>
              <p>Three</p>
            </Grid.Column>
            <Grid.Column width={3}>
              <p>Four</p>
            </Grid.Column>
            <Grid.Column width={3}>
              <p>Five</p>
            </Grid.Column>
          </Grid.Row>
        </Grid>
        )
    }
  }

  export default SpacingPage;
